import React, { useState } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";

function Article() {
  let { id } = useParams();

  const idArticle = id.replace(/[^0-9]+/g, "");
  const idTable = id.replace(/[0-9]+/g, "");

  const [article, setArticle] = useState([]);

  const fechArticle = async () => {
    try {
      const res = await axios.get(`http://localhost:8000/ver&escuchar/3`);
      setArticle(res.data);
      console.log(res.data);
    } catch (error) {
      console.log(error);
    }
  };
  fechArticle();

  return <div>Article {idArticle + " - " + idTable}</div>;
}

export default Article;
